import React from 'react'; 
import ReactDOM from 'react-dom'; 
import "style/index.css"; 


class VimeoPage extends React.Component {
    // constructor(props) {
    //     super(props)

    //     this.state = {}
    // }

    render() {
        return (
            <div className= "content">
                <div className= "white-box">
                    <h1>Monsoon</h1>
                    <img className= "white-box-img" src= "./monsoon.jpg" alt= "Monsoon image"></img>
                    <p className= "white-box-text">
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                        Donec tincidunt ipsum augue. In faucibus vehicula magna
                        pulvinar aliquam. Cras aliquam feugiat lorem non auctor. 
                        Quisque sed lorem egestas mauris venenatis commodo eu id
                        nibh. Ut porta libero sed semper faucibus. 
                    </p>
                </div>
                <div className= "gray-box">
                    <h1>Beams</h1>
                    <p className= "gray-box-text">
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                        Donec tincidunt ipsum augue. In faucibus vehicula magna
                        pulvinar aliquam. Cras aliquam feugiat lorem non auctor. 
                        Quisque sed lorem egestas mauris venenatis commodo eu id
                        nibh. Ut porta libero sed semper faucibus. 
                    </p> 
                    <img className= "gray-box-img" src= "./beams.jpg" alt= "Beams image"></img>
                </div>
                <div className= "gradient-box">
                    <h1>Move 2</h1>
                    <img className= "gradient-box-img" src= "./move2.jpg" alt= "Move 2 image"></img>
                    <p className= "gradient-box-text">
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                        Donec tincidunt ipsum augue. In faucibus vehicula magna
                        pulvinar aliquam. Cras aliquam feugiat lorem non auctor. 
                        Quisque sed lorem egestas mauris venenatis commodo eu id
                        nibh. Ut porta libero sed semper faucibus. 
                    </p>
                </div>
            </div>

        )
    }
}

ReactDOM.render(<VimeoPage />, document.getElementById('root'));
